property.code:
require.config({
    paths: {
       'css': '$services.webjars.url('require-css/0.1.7/css.js')',
       'domReady': '$services.webjars.url('requirejs-domready/2.0.1/domReady.js')',
       'datatables': '$services.webjars.url('datatables/1.10.19/js/jquery.dataTables.js')',
       'datatables-css': '$services.webjars.url('datatables/1.10.19/css/jquery.dataTables.min')'
    }
});

require(['jquery', 'datatables', 'css!datatables-css', 'domReady!'], function ($) {

    function computeBadgeStyle(value) {
      value = value.toLowerCase();
      switch (value) {
        case 'oui':
          return "success";
        case 'non':
          return "danger";
        case 'partiel':
          return "warning";
        case 'expérimentation':
          return 'info';
        case 'déploiement partiel':
          return 'warning';
        default:
          return "default";
      }
    }

    function computeUrlScoreBadgeStyle(value) {
      if (isNaN(value))
        return "default";
      if (value > 7)
        return "success";
      if (value >= 4 && value <= 7)
        return "warning";
      return "danger";
    }

    function getDemarcheStatisticsUrl(demarcheId) {
      var reference = XWiki.Model.resolve(demarcheId, XWiki.EntityType.DOCUMENT);
      var demarchePage = new XWiki.Document(reference);
      return demarchePage.getURL('view', 'view-mode=statistics');
    }

    function format(value, badgeStyleFunction, replaceNa, demarcheId) {
      var badgeStyle = badgeStyleFunction.apply(this, [value]);
      if (value) {
        if (replaceNa) {
          value = value.replace("n/a", "-");
        }
        value = value.replace("n/c", "Non disponible");
      }
      if (value && (value.indexOf('%') > 0)) {
        return '<span class="row-details-value">' + value + '</span>';
      } else if (value && value == '-') {
        return '<span class="row-details-value">' + value + '</span>';
      } else {
        return '<span class="row-details-value"><span class="label label-' + badgeStyle + '">' + value + '</span></span>';
      }
    }

    function displayChildRow(data) {
      var output = '<div class="row">' +
        '<div class="col-md-12">' +
        '<div class="row-details">' +
        '<ul>';
        var dateMiseEnLigne = data.dateMiseEnLigne.display;
        if (dateMiseEnLigne != 'Ouvert') {
          if (dateMiseEnLigne == 'n/c')
            dateMiseEnLigne = 'Non disponible';
          output += '<li><span class="row-details-key">' + "$services.localization.render("wikidemarches.observatoire.date-ouverture")" + '</span>' + dateMiseEnLigne + '</li>';
        }
        output = output + '<li><span class="row-details-key">' + "$services.localization.render("wikidemarches.observatoire.volumetrie")" + '</span>' + data.volumetrie.display + '</li>';
        var pourcentage = data.pourcentageRecoursVoieDematerialisee.display;
        if (data.statutDemat != 'Non') {
          output = output + '<li><span class="row-details-key">' + "$services.localization.render("wikidemarches.observatoire.pourcentage-recours-demat")" + '</span>' + pourcentage + '</li>';
        }
        if (data.avisCount.value >= 100) {
          var demarcheId = data.id;
          output = output + '<li><span class="row-details-key">' + "$services.localization.render("wikidemarches.observatoire.avis")" + '</span>' + data.avisCount.display + '</a></li>';
        }
        output = output + '</ul></div></div></div>';
      return output;
    }

    // Addition of a search function to the list of search functions for filtering on the ministère value.
    $.fn.dataTable.ext.search.push(
      function( settings, data, dataIndex ) {
        var selectedMinistere =  $('select[name="ministereSelect"]').val();
        var ministere = data[2];
        if (!selectedMinistere || selectedMinistere == "tous" || ministere == selectedMinistere) {
          return true;
        }
        return false;
      }
    );

    jQuery.extend( jQuery.fn.dataTableExt.oSort, {
      "french-string-asc" : function (s1, s2) {
          return s1.localeCompare(s2, 'fr');
      },

      "french-string-desc" : function (s1, s2) {
          return s2.localeCompare(s1, 'fr');
      }
    });

    var ministeres = [];

    var url = "$xwiki.getAttachmentURL('Demarches.Code.Top', 'data.json')";
    var parameters = new URLSearchParams(window.location.search);
    if (parameters.get('live') == '1') {
      url = "$xwiki.getURL('Demarches.Code.Top', 'view', 'execute=1&live=1')";
    }
    var table = $('#top-demarches').DataTable({
      ajax: {
        type: 'GET',
        url: url,
        dataSrc: function (json) {
          var data = json.data;
          for (var i = 0; i < data.length; i++) {
            var ministere = data[i].ministere;
            if (ministeres.indexOf(ministere) < 0) {
              ministeres.push(ministere);
            }
          };
          ministeres.sort(function (a, b) {
            return a.localeCompare(b, 'fr');
          });
         return json.data;
        }
      },
      paging: false,
      columns: [
            {
              className:      'details-control',
              orderable:      false,
              data:           null,
              defaultContent: ''
            },
            {
              data: "title",
              className: 'column-title',
              render : function (data, type, row) {
                return data + '<span class="ministere-groupe">' + row['ministere'] + (row['groupes'] ? (' - ' + row['groupes']) : '') + '</span>';
              }
            },
            {
              data: "ministere",
              visible: false,
              type: "french-string"
            },
            {
              data: "groupes",
              visible: false,
              type: "french-string"
            },
            { data: "statutDemat",
              render: function (data, type, row) {
                return format(data, computeBadgeStyle, true);
              }
            },
            {
              data: "franceConnect",
              render: function (data, type, row) {
                if (type === "sort") {
                  return data.display;
                } else {
                  return format(data.display, computeBadgeStyle, false);
                }
              }
            },
            {
              data: "adapteMobile",
              render: function (data, type, row) {
                if (type === "sort") {
                  return data.display;
                } else {
                  return format(data.display, computeBadgeStyle, false);
                }
              }
            },
            {
              data: "qualiteSupport",
              render: function (data, type, row) {
                return format(data, computeBadgeStyle, true);
              }
            },
            {
              data: "urlScore",
              type: "num",
              render: function (data, type, row) {
                if (type === "sort") {
                  return data.value;
                } else {
                  return format(data.display, computeUrlScoreBadgeStyle, true);
                }
              }
            },
            {
              data: "satisfactionIndex",
              type: "num",
              render: function (data, type, row) {
                if (type === "sort") {
                  return data.value;
                } else {
                  return format(data.display, computeBadgeStyle,  true, row['id']);
                }
              }
            },
            {
              data: "volumetrie",
              type: "num",
              visible: false,
              render: function (data, type, row) {
                if (type === "sort") {
                  return data.value;
                } else {
                  return data.display;
                }
              }
            },
            {
              data: "avisCount",
              type: "num",
              visible: false,
              render: function (data, type, row) {
                if (type === "sort") {
                  return data.value;
                } else {
                  return data.display;
                }
              }
            }
      ],
      // order by: avis, ministère, groupe, volumétrie, name
      order: [[11, 'desc'], [2, 'asc'], [3, 'asc'], [10, 'desc'], [1, 'asc']],
      language: {
        info: "Total : _TOTAL_ démarches",
        infoEmpty: "Aucune démarche trouvée",
        infoFiltered: "(filtrage appliqué sur _MAX_ total entrées)",
        loadingRecords: "Chargement...",
        processing: "Traitement...",
        search: "Démarche :",
        zeroRecords: "Aucune entrée trouvée"
      },
      initComplete: function(settings, json ) {
        // add the ministries filter in the filters
        var filtersContainer = $('#top-demarches_filter');
        if (filtersContainer) {
          // prepare the label and select of ministries
          var ministriesLabel = $('<label>Ministère :</label>')
          var ministriesSelect = $("<select name='ministereSelect'/>");
          ministriesLabel.append(ministriesSelect);
          ministriesSelect.empty();
          ministriesSelect.append($("<option />").val("tous").text("Tous"));
          $.each(ministeres, function() {
             ministriesSelect.append($("<option />").val(this).text(this));
          });
          // add the ministries select at the beginning of the filter line
          filtersContainer.prepend(ministriesLabel);
          // thanks, internet: https://datatables.net/forums/discussion/34352/passing-datatable-object-to-initcomplete-callback
          var this_tbl = settings.oInstance.api();
          ministriesSelect.change(function () {
            this_tbl.draw();
          });
        }
      }
    });

    $('#top-demarches tbody').on('click', 'td.details-control', function () {
      var tr = $(this).closest('tr');
      var row = table.row( tr );
      if ( row.child.isShown() ) {
        row.child.hide();
        tr.removeClass('shown');
      }
      else {
        row.child( displayChildRow(row.data()) ).show();
        tr.addClass('shown');
      }
    });
});

